import java.util.*;
import java.io.*;
class  Main {
    static Scanner sc = new Scanner(System.in);
    static StringBuilder sb = new StringBuilder();
    public static void main(String[] args) {
        int n = sc.nextInt();
        int k = sc.nextInt();
        int [] prices = new int[n];
        for(int i = 0 ; i < n;i++){
            prices[i] = sc.nextInt();
        }
        Arrays.sort(prices);
        int maxValue  = -1;
        int minDiff  =Integer.MAX_VALUE;
        int i = 0 ;
        int j = n-1;
        while(i < j){
            int temp = prices[i] + prices[j];
            if(temp <= k){
                if(temp > maxValue){
                    maxValue = temp;
                    minDiff = Math.abs(prices[i] - prices[j]);
                }else if(temp == maxValue){
                    minDiff = Math.min(minDiff,Math.abs(prices[i] -  prices[j]));
                }
                i++;
            }else{
                j--;
            }
        }
        if(maxValue == -1 ||  minDiff == Integer.MAX_VALUE){
            System.out.println(-1 + " "+  -1);
        }else{
            System.out.println(maxValue + " " +  minDiff);
        }


    }
}
